import React, { useRef, useState } from "react";


const WebBrowser = () => {
  const url = useRef;
  const updateUrl = (event) => {
    event.preventDefault();
    url.current = event.target.value;
    console.log()
  }
  return (
    <div>
      <div>
        <input type="text" onChange={updateUrl}></input>  
        <iframe src={url}></iframe>
      </div> 
    </div>
  );
};

export default WebBrowser;
